import '../App.css';
import Header from "../header/Header";
import SimpleMap from '../MapTest';
import { useState } from 'react';


const Dashboard = () => {

  const [isAuth, setIsAuth] = useState(localStorage.getItem('token') ? true : false)

  return (
    <>
      <Header />
      <SimpleMap />
    </>
  );
}

export default Dashboard;
